import React from 'react'

const Collection = () => {
    return (
        <section className='vh-100 bg-cover bg-no-repeat bg-star'>
            <div className='vh-100 d-flex align-items-center justify-content-between container'>
            <Row className='align-items-center justify-content-between'>
                </Row>
            </div>
        </section>
    )
}

export default Collection
